Defendant Davanta Lautrail Murphy in court with attorney Eric Richard Hart.  Irene Elizabeth Parthum appeared for the State of Wisconsin.

Matter here for a Plea/Sentencing.  As to the Plea:  AS TO COUNT #1:  Defendant was advised of constitutional rights and maximum penalties, waived all rights, and plead GUILTY.  Defendant examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum, and Jury Instructions received and filed.  Stipulation by parties to the Criminal Complaint as a factual basis to sustain the plea.  Court found the defendant guilty.  Judgment of conviction entered.
  
Court advised defendant that as a convicted felon he may never possess any gun or other firearms. 
Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.  

Court advised defendant if he is not a citizen of the United States of America, that upon a plea of guilty or no contest for this offense, he could be deported, excluded from admission to his country, or denied naturalization under federal law.  
Court advised that the defendant will have to provide a DNA sample, to the Wisconsin State Crime Laboratory for DNA testing and pay a DNA surcharge.

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:   
AS TO COUNT #1:  The Defendant's TOTAL LENGTH OF SENTENCE shall be THIRTY-SIX (36) months.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for EIGHTEEN (18) months with credit for THREE (3) days time served.  Defendant shall serve EIGHTEEN (18) months on EXTENDED SUPERVISION.  The Court STAYS sentence and orders PROBATION for THIRTY (30) months.

The defendant is not eligible for the Challenge Incarceration Program or the Wisconsin Substance Abuse Program.  
The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF PROBATION AND EXTENDED SUPERVISION (if revoked):
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Seek and maintain employment and/or school;
 - No contact with victim, Truely O., or her residence and no contact with co-actor, Monterio P.;
 - Pay restitution, joint and several with 15CF2294, in the amount of $3,538 to Truely O. and Maurice S.;  Restitution is to be paid BEFORE surcharges, costs and disbursements are paid.
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.   

Filed,
